webpackJsonp([2253],{"./node_modules/json-loader/index.js!./.cache/json/articles-certificates-comparison-with-the-equality-operator.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p>There are many <code>Comparison Operators</code> in JavaScript. All of these operators return a boolean <code>true</code> or <code>false</code> value.</p>\n<p>The most basic operator is the equality operator <code>==</code>. The equality operator compares two values and returns <code>true</code> if they\'re equivalent or <code>false</code> if they are not. Note that equality is different from assignment (=), which assigns the value at the right of the operator to a variable in the left.</p>\n<pre><code>function testEqual(myVal) {\n  if (myVal == 10) {\n     return "Equal";\n  }\n  return "Not Equal";\n}\n</code></pre>\n<p>If <code>myVal</code> is equal to <code>10</code>, the function will return "Equal". If it is not, the function will return "Not Equal".</p>\n<p>The equality operator will do its best to convert values for comparison, for example:</p>\n<pre><code>   1   ==  1        // true\n  "1"  ==  1        // true\n   1   == \'1\'       // true\n   0   == false     // true\n   0   == null      // false\n   0   == undefined // false\n null  == undefined // true\n</code></pre>',frontmatter:{title:"Comparison with the Equality Operator",parent:"/home/stuart/guides/src/pages/articles/certificates/comparison-with-the-equality-operator/index.md absPath of file"}}},pathContext:{slug:"/articles/certificates/comparison-with-the-equality-operator/"}}}});
